// pages/HomePage.js
import React, { useState } from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';
import Header from '../components/Header';
import TodayLog from '../components/TodayLog';
import Statistics from '../components/Statistics';
import Footer from '../components/Footer';
import { useHistory } from 'react-router-dom';

const HomePage = () => {
    const userName = "John";
    const dailySummary = { calories: 1200, protein: 45, carbs: 150, fats: 50 };
    const [foodEntries, setFoodEntries] = useState([
        { name: "Breakfast", calories: 300 },
        { name: "Lunch", calories: 600 },
        { name: "Dinner", calories: 500 },
    ]);

    const history = useHistory();

    const navigateToAddFood = () => {
        history.push('/search');
    };

    const handleAddFood = (food) => {
        setFoodEntries([...foodEntries, food]);
    };

    return (
        <Container>
            <Header />
            <Row>
                <Col md={8}>
                    <TodayLog foodEntries={foodEntries} onAddFood={navigateToAddFood} />
                </Col>
                <Col md={4}>
                    <Statistics {...dailySummary} />
                </Col>
            </Row>
            <Footer />
        </Container>
    );
};

export default HomePage;
